import './App.css';
import Home from './components/Home';
import React from 'react';
import {Route , Link} from "react-router-dom"

function App() {
  return (
    <div className="App">
      <Link to="/home">
        <h1>Henry Pokemon</h1>
      </Link>
      <Route path="/home" re/>
      <Home/>
    </div>
  );
}

export default App;
